window.bookSummaryJSON = "<p><b>New Powers and Old. A conflict millennia in the brewing. And at the center of it: one man.</b></p> <p>Michael has escaped the clutches of the Dark, if only temporarily. Surfacing in the world above, he finds matters no less complex than down below and survival as challenging as it had been in the dungeon.</p> <p><b>Is the harder path the one you must forge on your own?</b></p> <p>Many want Michael as their ally. Yet more want him dead, and the Dark is not done with him either. Can he find a way to navigate the treacherous waters of the Game and uncover the mysteries about himself?</p> <p><b>Or will Michael bend to Powers greater than him?</b></p> <p>Follow him on his epic journey of discovery and find out!</p>"; 
